import React from 'react';
// import logo from './logo.svg';
import './App.css';


function Welcome() {
  return (
    <div>
      <h1>WELCOME TO THE MADNESS OF MARCH</h1>
      <h4>This is a website introducing you to all the teams for the College Basetball tournament this march</h4>
  </div>
  )
}

interface TeamInfo {
  tid: number;
  cid: number;
  did: number;
  school: string;
  name: string;
  abbrev: string;
  pop: number;
  city: string;
  latitude: number;
  longitude: number;
}


const teamTest = [


    {"tid": 42, "cid": 8, "did": 16, "school": "Brigham Young", "name": "Cougars", "abbrev": "BYU", "pop": 278, "city": "Provo", "state": "UT", "latitude": 40.244, "longitude": -111.660},


]

class Team extends React.Component<TeamInfo> {
  render() {
    const oneTeam = this.props;

    return (
      <div>
        <h2>{oneTeam.school}</h2>
        <h2>{oneTeam.name}</h2>
        <h3>TID: {oneTeam.tid}</h3>
        <h3>CID: {oneTeam.cid}</h3>
        <h3>DID: {oneTeam.did}</h3>
        <h3>abbrev: {oneTeam.abbrev}</h3>
        <h3>pop: {oneTeam.pop}</h3>
        <h3>city: {oneTeam.city}</h3>
        <h3>latitude: {oneTeam.latitude}</h3>
        <h3>longitude: {oneTeam.longitude}</h3>


      </div>
    );
  }
}

function TeamList() {
  return (
    <div>
      {teamTest.map((num) => (
        <Team {...num} />
      ))}
    </div>
  );
}

function App() {
  return (
    <div className="App">
      <Welcome/>
      <TeamList />

    </div>
  );
}

export default App;
